Implement marketing strategy and site content schedule for website, updating with seasonal and promotional content;
 Recommend and implement testing to improve the website experience;
Lead SEO optimization with 3rd party vendor support;
Monitor and report on customer journey and site experience, providing recommendations for improvements;
Partner with IT and 3rd party vendors on development and management of website;
Leverage analytics to enhance overall customer experience.

Designed and implemented campaigns, promotion materials, annual reports, social media and website;
Developed information architectures for website of varying sizes, creating deliverables such as content inventories, content plans and personas;
Updated and interpreted data of the usability from its Sina.weibo.

Collected, screened new data and drafted press releases;
Prepared interview outlines, conducted interviews and surveys;
Sharpened writing and electronic media skills: wrote 33 news reports, including topic selection and published 39 entertainment press releases.

Create a social media campaign based about reducing the stigma of IBD via awareness. We would be hoping to utilize social media accounts (Facebook and Twitter mostly) to post helpful information both for those who have IBD and those who may not know much about it at all;
Contacting online support groups for those who have IBD and similar conditions. We could send out an anonymous survey to see what patients' perfections are of IBD and its general effect on their daily lives;
Conducting focus groups for those who wish to provide feedback. This is not limited to online support groups like idea #2, so it would be a survey given a more general population of those with IBD. We would also ask the general public about their perceptions of IBD and where they get health information from. Generally, this idea would be more about asking about awareness/public knowledge of the disease than asking about a patient's experience with IBD.
